import React, { useState } from "react";
import { Menu, Switch, Button, Col,Row } from "antd";
import { Link } from "react-router-dom";
import "./css/styles.css";

import {
  MailOutlined,
  CalendarOutlined,
  AppstoreOutlined,
  SettingOutlined,
  MenuUnfoldOutlined,
  MenuFoldOutlined,
  HomeOutlined,
} from "@ant-design/icons";
const Index = (props) => {
  const [current, setCurrent] = useState("home");
  const handleClick = (e) => {
    setCurrent(e.key);
  };
  const { SubMenu } = Menu;

  return (
    <Menu
      onClick={handleClick}
      selectedKeys={current}
      mode="horizontal  "
    >
      <Row>
        <Col flex={1}></Col>
        <Col flex={2}>
        <Menu.Item key="mail" icon={<MailOutlined />}>
          Navigation One
        </Menu.Item>
        </Col>
        <Col></Col>
      </Row>
    </Menu>
  );
};

export default Index;
